import React, {useEffect} from 'react';
import Button from '@material-ui/core/Button';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
// import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Link from '@material-ui/core/Link';
import { useSelector, useDispatch } from 'react-redux';
import Header from '../components/Header';
import {Actions} from '../actions';
import './ProductList.css';
import { fade, makeStyles } from '@material-ui/core/styles';
import SearchIcon from '@material-ui/icons/Search';
import InputBase from '@material-ui/core/InputBase';

const defaultImage = "data:image/png;base64,";

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright Â© '}
      <Link color="inherit" href="https://material-ui.com/">
        www.doaquafishes.com
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const useStyles = makeStyles((theme) => ({
  icon: {
    marginRight: theme.spacing(2),
  },
  heroContent: {
    backgroundColor: "#cccccc29",
    padding: theme.spacing(8, 0, 6),
  },
  heroButtons: {
    marginTop: theme.spacing(4),
  },
  cardGrid: {
    paddingTop: theme.spacing(8),
    paddingBottom: theme.spacing(8),
  },
  card: {
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
  },
  cardMedia: {
    paddingTop: '56.25%', // 16:9
  },
  cardContent: {
    flexGrow: 1,
  },
  footer: {
    backgroundColor: "#cccccc29",
    padding: theme.spacing(6),
  },
  search: {
    position: 'relative',
    borderRadius: theme.shape.borderRadius,
    backgroundColor: fade(theme.palette.common.white, 0.15),
    '&:hover': {
      backgroundColor: fade(theme.palette.common.white, 0.25),
    },
    marginLeft: 0,
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      marginLeft: theme.spacing(1),
      width: 'auto',
    },
  },
  searchIcon: {
    padding: theme.spacing(0, 2),
    height: '100%',
    position: 'absolute',
    pointerEvents: 'none',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
  },
  inputRoot: {
    color: 'inherit',
  },
  inputInput: {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)}px)`,
    transition: theme.transitions.create('width'),
    width: '100%',
    [theme.breakpoints.up('sm')]: {
      width: '12ch',
      '&:focus': {
        width: '20ch',
      },
    },
  },
}));


export default function ProductList() {
  const classes = useStyles();
  const dispatch = useDispatch();
  const productList = useSelector(state => state.list.list);

  useEffect(()=>{
    dispatch(Actions.list());
  },[]);

  const deleteItem=(item)=>{
    dispatch(Actions.deleteListItem(item));
  }

  return (
    <React.Fragment>
      <Header/>
      <main>
        <div className={classes.heroContent}>
          <Container maxWidth="sm">
            <Typography component="h1" variant="h2" align="center" color="textPrimary" gutterBottom>
              DO AQUA FISHES
            </Typography>
            <Typography variant="h5" align="center" color="textSecondary" paragraph>
             Wide variety of ornamental fishes which are very energetic, stunning, and healthy.
            </Typography>
          </Container>
        </div>

        <Container className={classes.cardGrid} maxWidth="md">
          <div className="search-container row d-flex">

            <div className="search col-4">
                <div className={classes.searchIcon}>
                  <SearchIcon />
                </div>
                <InputBase
                  placeholder="Searchâ¦"
                  classes={{
                    root: classes.inputRoot,
                    input: classes.inputInput,
                  }}
                  inputProps={{ 'aria-label': 'search' }}
                  // onKeyDown={(e)=> search(e)}
                  />
                  </div>
            <div className="search col-8">

              <a href={`/products/add-product`}>
                <Button size="large" variant="contained" color="primary" className="float-right">
                  Add New
                </Button>
              </a>
              </div>
              </div>
          <Grid container spacing={4}>
            {productList?.map((prod) => (
              <Grid item key={prod.prod_id} xs={12} sm={6} md={4}>
                <Card className={classes.prod}>
                  <CardMedia
                    className={classes.cardMedia}
                    image={prod?.image ? prod.image : defaultImage}
                    title="Image title"
                  />
                  <CardContent className={classes.cardContent}>
                    <Typography gutterBottom variant="h5" component="h2">
                      {prod?.name}
                    </Typography>
                    <Typography>
                      {prod.description}
                    </Typography>
                  </CardContent>
                  <CardActions>
                      <a href={`/products/${prod.prod_id}`}>
                        <Button size="small" variant="contained" color="primary">
                          Edit
                        </Button>
                      </a>
                      <Button onClick={()=> deleteItem(prod)} variant="contained" size="small" color="secondary">
                        Delete
                      </Button>
                  </CardActions>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </main>
      {/* Footer */}
      <footer className={classes.footer}>
        <Typography variant="h6" align="center" gutterBottom>
          Do Aqua Fishes
        </Typography>
        <Typography variant="subtitle1" align="center" color="textSecondary" component="p">
          Wide variety of ornamental fish collection!
        </Typography>
        <Copyright />
      </footer>
      {/* End footer */}
    </React.Fragment>
  );
}
